import BiographyContainer from '../Containers/BiographyContainer';
import WorkHistoryContainer from "../Containers/WorkHistoryContainer";
import '../Styles/Home.css'
import projData from "../Content/workHistory.json"

function Home () {
    console.log(projData)
    let projectData = ''
    fetch(projData)
        .then(response => {
            return response.json();
        }).then(jsonData => console.log(jsonData))

    return(
        <div className="homeLayout">
            <BiographyContainer />
            <WorkHistoryContainer projects={[{title:"Project 1", image:"project_1_image"},{title:"Project 2", image:"project_2_image"}]}/>
        </div>
    );
}

export default Home;
